(function(){new Vue({el:"#app",data:{list:pageData.list},methods:{create:function(){window.location="/Sale/FullReduce"},timeFilter:function(n){return n.isForeverValid?"永久":n.startDate.substring(0,10)+" 至 "+n.endDate.substring(0,10)},stateFilter:function(n){if(n.isForeverValid)return"进行中";var t=(new Date).format("yyyy-MM-dd");return t>n.endDate.substring(0,10)?"已过期":t<n.startDate.substring(0,10)?"尚未开始":"进行中"},edit:function(n){window.location="/Sale/FullReduce/"+n.id},remove:function(n,t){var i=this;$.primary("确定删除该活动？",function(){return axios.delete("/Sale/DeleteFullReduce/"+n.id).then(function(n){if(!n.data.success){$.alert(n.data.msg);return}$.alert(n.data.msg,"success");i.list.splice(t,1)}).catch(function(n){$.alert(n)}),!0})}}})})();